(7, 17, '<table style=\"height: 212px;\" width=\"915\">\n<tbody>\n<tr>\n<td style=\"width: 449.5px;\">\n<div>&nbsp;</div>\n<div>\n<h4 class=\"text-primary fw-bolder cursor-pointer mb-0\">First Set</h4>\n<div class=\"m-0\">\n<div class=\"d-flex align-items-center  py-3  mb-0\">\n<div class=\"m-0\">\n<div class=\"d-flex align-items-center  py-3  mb-0\">\n<h6 class=\"text-gray-700  cursor-pointer mb-0\">Kung di rin lang</h6>\n</div>\n</div>\n<div class=\"m-0\">\n<div class=\"d-flex align-items-center  py-3  mb-0\">\n<h6 class=\"text-gray-700  cursor-pointer mb-0\">Far Away</h6>\n</div>\n</div>\n<div class=\"m-0\">\n<div class=\"d-flex align-items-center  py-3  mb-0\">\n<h6 class=\"text-gray-700  cursor-pointer mb-0\">Out of reach</h6>\n</div>\n</div>\n<div class=\"m-0\">\n<div class=\"d-flex align-items-center  py-3  mb-0\">\n<h6 class=\"text-gray-700  cursor-pointer mb-0\">I knew I loved you</h6>\n</div>\n</div>\n<div class=\"m-0\">\n<div class=\"d-flex align-items-center  py-3  mb-0\">\n<h6 class=\"text-gray-700  cursor-pointer mb-0\">You to me are everything</h6>\n</div>\n</div>\n<div class=\"m-0\">\n<div class=\"d-flex align-items-center  py-3  mb-0\">\n<h6 class=\"text-gray-700  cursor-pointer mb-0\">Chasing Pavements</h6>\n</div>\n</div>\n<div class=\"m-0\">\n<div class=\"d-flex align-items-center  py-3  mb-0\">\n<h6 class=\"text-gray-700  cursor-pointer mb-0\">Put your records on</h6>\n</div>\n</div>\n<div class=\"m-0\">\n<div class=\"d-flex align-items-center  py-3  mb-0\">\n<h6 class=\"text-gray-700  cursor-pointer mb-0\">Cool Off</h6>\n</div>\n</div>\n<div class=\"m-0\">\n<div class=\"d-flex align-items-center  py-3  mb-0\">\n<h6 class=\"text-gray-700  cursor-pointer mb-0\">Ewan</h6>\n</div>\n</div>\n<div class=\"m-0\">\n<div class=\"d-flex align-items-center  py-3  mb-0\">\n<h6 class=\"text-gray-700  cursor-pointer mb-0\">If you leave me now</h6>\n</div>\n</div>\n</div>\n</div>\n</div>\n<div>\n<h4 class=\"text-primary fw-bolder cursor-pointer mb-0\">Second Set</h4>\n<div class=\"m-0\">\n<div class=\"d-flex align-items-center  py-3  mb-0\">\n<div class=\"m-0\">\n<div class=\"d-flex align-items-center  py-3  mb-0\">\n<h6 class=\"text-gray-700  cursor-pointer mb-0\">Hot and cold</h6>\n</div>\n</div>\n<div class=\"m-0\">\n<div class=\"d-flex align-items-center  py-3  mb-0\">\n<h6 class=\"text-gray-700  cursor-pointer mb-0\">Paparazzie</h6>\n</div>\n</div>\n<div class=\"m-0\">\n<div class=\"d-flex align-items-center  py-3  mb-0\">\n<h6 class=\"text-gray-700  cursor-pointer mb-0\">Awitin mo isasayaw ko</h6>\n</div>\n</div>\n<div class=\"m-0\">\n<div class=\"d-flex align-items-center  py-3  mb-0\">\n<h6 class=\"text-gray-700  cursor-pointer mb-0\">Manila Girl</h6>\n</div>\n</div>\n<div class=\"m-0\">\n<div class=\"d-flex align-items-center  py-3  mb-0\">\n<h6 class=\"text-gray-700  cursor-pointer mb-0\">Last Friday Night</h6>\n</div>\n</div>\n<div class=\"m-0\">\n<div class=\"d-flex align-items-center  py-3  mb-0\">\n<h6 class=\"text-gray-700  cursor-pointer mb-0\">I love the night life</h6>\n</div>\n</div>\n<div class=\"m-0\">\n<div class=\"d-flex align-items-center  py-3  mb-0\">\n<h6 class=\"text-gray-700  cursor-pointer mb-0\">Rockabye</h6>\n</div>\n</div>\n<div class=\"m-0\">\n<div class=\"d-flex align-items-center  py-3  mb-0\">\n<h6 class=\"text-gray-700  cursor-pointer mb-0\">Price tag</h6>\n</div>\n</div>\n<div class=\"m-0\">\n<div class=\"d-flex align-items-center  py-3  mb-0\">\n<h6 class=\"text-gray-700  cursor-pointer mb-0\">Superstar</h6>\n</div>\n</div>\n<div class=\"m-0\">\n<div class=\"d-flex align-items-center  py-3  mb-0\">\n<h6 class=\"text-gray-700  cursor-pointer mb-0\">Girl in the mirror</h6>\n</div>\n</div>\n</div>\n</div>\n</div>\n<div>&nbsp;</div>\n</td>\n<td style=\"width: 449.5px;\">&nbsp;\n<div>\n<h4 class=\"text-primary fw-bolder cursor-pointer mb-0\">First Set</h4>\n<div class=\"m-0\">\n<div class=\"d-flex align-items-center  py-3  mb-0\">\n<div class=\"m-0\">\n<div class=\"d-flex align-items-center  py-3  mb-0\">\n<h6 class=\"text-gray-700  cursor-pointer mb-0\">In your eyes</h6>\n</div>\n</div>\n<div class=\"m-0\">\n<div class=\"d-flex align-items-center  py-3  mb-0\">\n<h6 class=\"text-gray-700  cursor-pointer mb-0\">Ill never go</h6>\n</div>\n</div>\n<div class=\"m-0\">\n<div class=\"d-flex align-items-center  py-3  mb-0\">\n<h6 class=\"text-gray-700  cursor-pointer mb-0\">Binibini</h6>\n</div>\n</div>\n<div class=\"m-0\">\n<div class=\"d-flex align-items-center  py-3  mb-0\">\n<h6 class=\"text-gray-700  cursor-pointer mb-0\">Closer</h6>\n</div>\n</div>\n<div class=\"m-0\">\n<div class=\"d-flex align-items-center  py-3  mb-0\">\n<h6 class=\"text-gray-700  cursor-pointer mb-0\">Hero</h6>\n</div>\n</div>\n<div class=\"m-0\">\n<div class=\"d-flex align-items-center  py-3  mb-0\">\n<h6 class=\"text-gray-700  cursor-pointer mb-0\">100 years</h6>\n</div>\n</div>\n<div class=\"m-0\">\n<div class=\"d-flex align-items-center  py-3  mb-0\">\n<h6 class=\"text-gray-700  cursor-pointer mb-0\">Perfect</h6>\n</div>\n</div>\n<div class=\"m-0\">\n<div class=\"d-flex align-items-center  py-3  mb-0\">\n<h6 class=\"text-gray-700  cursor-pointer mb-0\">Night Changes</h6>\n</div>\n</div>\n<div class=\"m-0\">\n<div class=\"d-flex align-items-center  py-3  mb-0\">\n<h6 class=\"text-gray-700  cursor-pointer mb-0\">September</h6>\n</div>\n</div>\n<div class=\"m-0\">\n<div class=\"d-flex align-items-center  py-3  mb-0\">\n<h6 class=\"text-gray-700  cursor-pointer mb-0\">Just the way you are</h6>\n</div>\n</div>\n</div>\n</div>\n</div>\n<div>\n<h4 class=\"text-primary fw-bolder cursor-pointer mb-0\">Second Set</h4>\n<div class=\"m-0\">\n<div class=\"d-flex align-items-center  py-3  mb-0\">\n<div class=\"m-0\">\n<div class=\"d-flex align-items-center  py-3  mb-0\">\n<h6 class=\"text-gray-700  cursor-pointer mb-0\">Lets Groove</h6>\n</div>\n</div>\n<div class=\"m-0\">\n<div class=\"d-flex align-items-center  py-3  mb-0\">\n<h6 class=\"text-gray-700  cursor-pointer mb-0\">Can\'t stop the feeling</h6>\n</div>\n</div>\n<div class=\"m-0\">\n<div class=\"d-flex align-items-center  py-3  mb-0\">\n<h6 class=\"text-gray-700  cursor-pointer mb-0\">There\'s nothing holding me back</h6>\n</div>\n</div>\n<div class=\"m-0\">\n<div class=\"d-flex align-items-center  py-3  mb-0\">\n<h6 class=\"text-gray-700  cursor-pointer mb-0\">Awitin mo isasayaw ko</h6>\n</div>\n</div>\n<div class=\"m-0\">\n<div class=\"d-flex align-items-center  py-3  mb-0\">\n<h6 class=\"text-gray-700  cursor-pointer mb-0\">Obladi Oblada</h6>\n</div>\n</div>\n<div class=\"m-0\">\n<div class=\"d-flex align-items-center  py-3  mb-0\">\n<h6 class=\"text-gray-700  cursor-pointer mb-0\">Rude</h6>\n</div>\n</div>\n<div class=\"m-0\">\n<div class=\"d-flex align-items-center  py-3  mb-0\">\n<h6 class=\"text-gray-700  cursor-pointer mb-0\">Solo</h6>\n</div>\n</div>\n<div class=\"m-0\">\n<div class=\"d-flex align-items-center  py-3  mb-0\">\n<h6 class=\"text-gray-700  cursor-pointer mb-0\">Cake by the ocean</h6>\n</div>\n</div>\n<div class=\"m-0\">\n<div class=\"d-flex align-items-center  py-3  mb-0\">\n<h6 class=\"text-gray-700  cursor-pointer mb-0\">Ang Tigulang</h6>\n</div>\n</div>\n<div class=\"m-0\">\n<div class=\"d-flex align-items-center  py-3  mb-0\">\n<h6 class=\"text-gray-700  cursor-pointer mb-0\">Sugar</h6>\n</div>\n</div>\n</div>\n</div>\n</div>\n</td>\n</tr>\n</tbody>\n</table>', 0, 0, 0, '2022-07-04 06:10:35'),
