(151, 'Kanlungan', 113, '<p>[Intro]</p>\r\n<p>&gt;E A B C#m<br />&gt;A/G# F#m B7<br /> <br /> <br />[Verse]<br /> <br />&gt;E C#m A - B<br />pana-panahon ang pagkakataon <br />&gt;E A B C#m<br />maibabalik ba ang kahapon?</p>\r\n<p>&gt;A/G# F#m B7<br /> <br />&gt;A B C#m<br />natatandaan mo pa ba, <br />&gt;A B E - C#m<br />nang tayong dalwa ang unang nagkita?<br />&gt;A B C#m<br />panahon ng kamusmusan<br />&gt;A B C#m<br />sa piling ng mga bulaklak at halaman<br />&gt;A B C#m<br />doon tayong nagsimulang<br />&gt;A B C#m<br />mangarap at tumula <br /> <br /> <br />[Instrumental]<br /> <br />&gt;A/G# F#m B7<br /> <br /> <br />[Verse]<br /> <br />&gt;A B C#m<br />natatandaan mo pa ba,<br />&gt;A B E C#m<br />inukit kong puso sa punong mangga<br />&gt; A B C#m<br />at ang inalay kong gumamela<br />&gt;A B C#m<br />magkahawak-kamay sa dalampasigan<br />&gt;A B C#m<br /> malayang tulad ng mga ibon<br />&gt;A B E7<br /> ang gunita ng ating kahapon</p>\r\n<p><br />&gt; A B C#m<br /> ang mga puno\'t halaman<br />&gt;A B C#m<br /> ay kabiyak ng ating gunita<br />&gt;A B C#m B Bbm A B<br /> sa paglipas ng panahon bakit kailangan ding lumisan?</p>\r\n<p>&gt;E C#m A - B<br />(pana-panahon ang pagkakataon<br />&gt;E A B C#m<br />maibabalik ba ang kahapon?<br /> <br /> <br />[Instrumental]</p>\r\n<p>&gt;E A B C#m<br />&gt;A/G# - B/F# - A - B<br /> <br /> <br />(Do chords) as show on above<br />&gt;A B C#m <br />ngayon ikaw ay nagbalik<br />&gt;A B E C#m<br />at tulad ko rin ang iyong pananabik<br />&gt;A B C#m<br />makita ang dating kanlungan<br />&gt;A B C#m<br />tahanan ng ating tula at pangarap<br />&gt;A B C#m<br />ngayon ay naglaho na<br />&gt;A B E<br />saan hahanapin pa?</p>\r\n<p><br />&gt;A B C#m <br />lumilipas ang panahon<br />&gt;A B C#m<br />kabiyak ng ating gunita<br />&gt;A B C#m B Bbm A B<br />ang mga puno\'t halaman bakit kailangan lumisan?</p>\r\n<p><br />&gt;E C#m A - B<br />(pana-panahon ang pagkakataon<br />&gt;E A B C#m<br />maibabalik ba ang kahapon?</p>\r\n<p>[SOLO]<br />&gt; A B C#m<br />&gt; A B E C#m<br />&gt; A B C#m<br />&gt; A B E</p>\r\n<p>&gt;A B C#m <br />lumilipas ang panahon<br />&gt;A B C#m<br />kabiyak ng ating gunita<br />&gt;A B C#m B Bbm A B<br />ang mga puno\'t halaman bakit kailangan lumisan?</p>\r\n<p>&gt;E C#m A - B<br />(pana-panahon ang pagkakataon<br />&gt;E A B C#m<br />maibabalik ba ang kahapon?<br /> <br /> <br />[Outro]<br /> <br />A/G# - B/F# - A - B</p>\r\n<p>A/G# - B/F# - A - B</p>\r\n<p>&gt;E</p>', 'opm classic', '', '', '2022-06-19 09:23:51'),
