br />sabi mo na mahal mo &lsquo;ko<br />&gt; B7<br />ngunit di naman seryoso<br />&gt;G<br />sana magkasingkulay<br />&gt; Gm D<br />ang drama at tunay na buhay ko<br />&gt;Bm E7<br />ang tanging pag-asa ko<br />&gt; A7<br />ay nasa tambalang ito<br /> <br /> <br />[Outro]<br /> <br />&gt;G - D</p>', 'opm rock', 'D', '', '2022-09-18 00:04:54'),
(702, 'Ayokong Tumanda', 39, '<p>[Intro]<br />&gt;B G#m C#m Em F#m<br /> <br />&gt; B G#m<br />e|---11-11--9--7-9--11-11--9-7-7--9--| e|---11-11--9--7-9--11-11--9-7-7--9--|<br />B|-----------------------------------| B|-----------------------------------|<br />G|-----------------------------------| G|-----------------------------------|<br />D|-----------------------------------| D|-----------------------------------|<br />A|-----------------------------------| A|-----------------------------------|<br />E|-----------------------------------| E|-----------------------------------|<br /> <br />&gt; C#m Em F#<br />e|---15-15--13--11-13--15-15--13-11-11--13--| e|---14-14--12--10-12--14-14--12-10-10--12--|<br />B|------------------------------------------| B|------------------------------------------|<br />G|------------------------------------------| G|------------------------------------------|<br />D|------------------------------------------| D|------------------------------------------|<br />A|------------------------------------------| A|------------------------------------------|<br />E|------------------------------------------| E|------------------------------------------|<br /> <br /> <br />[Verse]<br />&gt;B G#m<br />Naiinis ako pag naiisip ko<br />&gt;C#m Em<br />Lahat ng tao ay tumatanda<br />&gt;F#m<br />Aahhh &hellip;<br />&gt;B G#m<br />Naisip mo na ba pag tayo tumanda<br />&gt;C#m Em<br />Isa-isa na tayong mawawala<br />&gt;F#<br />Aahhh &hellip;<br /> <br /> <br />[Refrain]<br />&gt;G#m C#m<br />Naaalala mo pa ba ang panahon<br />&gt;F# B<br />Nung excited ka pa sa birthday mo taon-taon<br />&gt;G#m C#m<br />Ngayon puting buhok mo ay lumalabas<br />&gt;E F#<br />Kalendaryo ay gusto mong i-atras<br /> <br /> <br />[Chorus] (x2)<br />&gt;B<br />Ayokong tumanda<br />&gt;G#m<br />Ayokong tumanda<br />&gt;C#m<br />Ayokong tumanda<br />&gt;Em<br />Ayokong tumanda<br />&gt;F#<br />Kung hindi ka kasama<br /> <br /> <br />[Verse]<br />Natakot lang ako noong sinabi mo<br />Na ayaw mong ako ang mauna<br />Ahhh<br />Ang sabi ko sa sa yo mas lalong ayaw ko<br />Mawala ka at ako ang matira<br />Aahhh<br /> <br /> <br />[Refrain]<br />Naaalala mo pa ba ang panahon<br />Nung excited ka pa sa birthday mo taon-taon<br />Ngayon puting buhok mo ay lumalabas<br />Kalendaryo ay gusto mong i-atras<br /> <br /> <br />(Repeat Chorus) (x2)<br />&gt;B<br />Ayokong tumanda<br />&gt;G#m<br />Ayokong tumanda<br />&gt;C#m<br />Ayokong tumanda<br />&gt;Em<br />Ayokong tumanda<br />&gt;F#<br />Kung hindi ka kasama</p>\r\n<p>(Repeat) (x2)<br />&gt;B G#m C#m Em F# C#<br />Ha ha ha ha Ayokong tumanda</p>\r\n<p>Change key +2<br />(Repeat Chorus) (x2)</p>', 'opm rock', 'B', '', '2022-09-18 00:09:36'),
