(742, 'Tell me', 249, '<p>TELL ME<br />jinsanity<br />PEK-2\'S BAND<br /> <br />[Intro] <br />&gt;C Em/Bm F Em Am Bdim E E7 - A<br /> <br />[Verse 1]<br />&gt;A E/G#m F#m E/G#m - F#m <br />There are nights when I can\'t help but cry<br />&gt;C#/F F#m E Bm/Eb E<br /> And I wonder why you have to leave me<br />&gt;A E/G#m F#m E/G#m - F#m <br />Why did it have to end so soon?<br />&gt;C#/F F#m E Bm/Eb E <br />When you said that you would never leave me<br /> <br />[Chorus]<br />&gt;C#m F#m D C#m F#m<br /> Tell me, where did I go wrong<br />&gt;D C#m F#m G/Bm E<br />What did I do to make you change your mind completely?<br />&gt; C#m F#m D C#m F#m<br />Then I thought this love would never end<br />&gt; D C#m F#m<br />But if this love\'s not ours to have<br />&gt; Bm E A G#m F#m E<br />l let it go with your goodbye<br /> <br />[Verse 2]<br /> <br />&gt;A E/G#m F#m E/G#m - F#m <br />Why did it have to end so soon?<br />&gt;C#/F F#m E Bm/Eb E<br />When you said that you would never leave me<br /> <br />[Chorus]<br />&gt;C#m F#m D C#m F#m<br /> Tell me, where did I go wrong<br />&gt;D C#m F#m G/Bm E<br />What did I do to make you change your mind completely?<br />&gt; C#m F#m D C#m F#m<br />Then I thought this love would never end<br />&gt; D C#m F#m<br />But if this love\'s not ours to have<br />&gt; Bm E <br />l let it go with your goodbye<br /> <br />[ADLIB]<br />&gt;A G#m F# E/G#<br />&gt;D C#m Bm C#m - B - Bb <br />&gt;B G#m - F#m - E</p>\r\n<p><br />[Chorus]<br />&gt;C#m F#m D C#m F#m<br /> Tell me, where did I go wrong<br />&gt;D C#m F#m G/Bm E<br />What did I do to make you change your mind completely?<br />&gt; C#m F#m D C#m F#m<br />Then I thought this love would never end<br />&gt; D C#m F#m<br />But if this love\'s not ours to have<br />&gt; Bm E <br />l let it go with your goodbye<br /> </p>', 'opm classic', 'A', '', '2022-10-06 07:22:44'),
(743, 'Yesterday', 120, '<p>[Verse 1]<br />&gt; F Em7 A7 Dm Dm/C<br />Yesterday, all my troubles seemed so far away<br />&gt;Bb C7 F F/E Dm G7 Bb F F<br />Now it looks as though they\'re here to stay, oh I believe in yesterday<br /> <br />[Verse 2]<br />&gt;F Em7 A7 Dm Dm/C<br />Suddenly, I\'m not half the man I used to be<br />&gt;Bb C7 F F/E Dm G7 Bb F F<br /> There\'s a shadow hanging over me, oh yesterday came suddenly<br /> <br />[Chorus]<br />&gt;Em7 A7 Dm Dm/C Bb Gm C F<br />Why she had to go I don\'t know, she wouldn\'t say<br />&gt;Em7 A7 Dm Dm/C Bb Gm C F<br />I said something wrong, now I long for yesterday<br /> <br />[Verse 3]<br />&gt;F Em7 A7 Dm Dm/C<br />Yesterday, love was such an easy game to play<br />&gt;Bb C7 F F/E Dm G7 Bb F F<br /> Now I need a place to hide away, oh I believe in yesterday<br /> <br />[Chorus]<br />&gt;Em7 A7 Dm Dm/C Bb Gm C F<br /> Why she had to go I don\'t know, she wouldn\'t say<br />&gt;Em7 A7 Dm Dm/C Bb Gm C F<br />I said something wrong, now I long for yesterday<br /> <br />[Verse]<br />&gt;F Em7 A7 Dm Dm/C<br />Yesterday, love was such an easy game to play<br />&gt;Bb C7 F F/E Dm G7 Bb F F<br /> Now I need a place to hide away, oh I believe in yesterday<br /> <br />[Outro]<br />&gt;Dm B/G7 Bb F F<br />mm mm mm mm mm mm mmmmmmmmm</p>', 'foreign classic', 'F', '', '2022-10-06 07:25:03'),
(744, 'Forevermore(Jed Madela)', 277, '<p>Intro: <br />&gt;D9 - A - G - D9 - F - G<br /> <br />&gt;D9 A/C#<br />They see me out my friend<br />&gt; C G/B<br />I\'ve something to say that\'s from within<br />&gt;D9 A/C# C G/B<br />It\'s a last memory, try to think back<br /> <br />I\'ll help you see&hellip;<br /> <br />Em9 F#m Bm<br />All of those nights we shared<br />Em F#m A<br />All of those days you were there<br /> <br />Chorus:<br /> D F#m G<br />I just wanna love you forevermore <br /> A D F#m G<br />And I wanna hold you just like before<br /> Bm Bm+M7 Bm E7<br />And maybe someday, we might just find a way<br /> Em A D-F-G(2x)<br />And we can love forevermore&hellip;<br /> <br />D9 A/C#<br />If I could turn back time<br />C G/B<br />I would have never let you go<br />D9 A/C#<br />And you would still be mine<br />C G/B<br />But here I am crying all alone<br /> <br />Em9 F#m Bm<br />All of the love we shared<br />Em9 F#m A<br />All of those days you were there<br /> <br />Chorus:<br /> D F#m G<br />I just wanna love you forevermore <br /> A D F#m G<br />And I wanna hold you just like before<br /> Bm Bm+M7 Bm E7<br />And maybe someday, we might just find a way<br /> Em A D<br />And we can love forevermore&hellip;<br /> <br />Bridge:<br />F G<br />Oh I\'m lost without you<br /> C B Am<br />Oh tell me what should I do, <br /> G F<br />Now that you\'re gone..<br /> Em<br />I can\'t go on all alone<br /> Dm<br />I\'m a lonely man, <br /> G B<br />I need you again&hellip;&hellip;<br /> <br />Chorus:<br /> E G#m A<br />I just wanna love you forevermore <br /> B E G#m A<br />And I wanna hold you just like before<br /> C#m C#m+M7 C#m F#7<br />And maybe someday, we might just find a way<br /> F#m B E-G-A....<br />And we can love forevermore&hellip;</p>', 'opm classic', 'D', '', '2022-10-06 07:29:21'),
