(753, 'When I\'m gone', 436, '<p>[Intro]<br />&gt;D Dsus2 D G A<br />&gt;D Dsus2 D G A<br /> <br />[Verse 1]<br />&gt; D<br />When I\'m gone<br />&gt; B7<br />Will you take good care of everything?<br />&gt; Em<br />Will you keep wearing your wedding ring?<br />&gt; A<br />When I\'m gone<br />&gt; D<br />And when I\'m gone<br />&gt; B7<br />Will you take out all the photographs<br />&gt; Em <br />Maybe spend a moment in the past?<br />&gt; A<br />When I\'m gone<br /> <br />[Pre-chorus]<br />&gt; F#m Bm<br />Will you miss me in the night?<br />&gt; Em A G<br />Will your arms reach out to hold me tight<br />&gt; F#m Bm<br />And keep me in your dreams<br />&gt; G A<br />In your heart, in your life?<br /> <br />[Chorus]<br />&gt; D Bm<br />Sometimes I\'ll wanna run to you like lovers do<br />&gt; Em F# G<br />When love is new and just for a moment be close to you<br />&gt; A<br />Pretending I\'m still holding you.<br />&gt; D Bm<br />And even when I\'m far away the dreams will stay.<br />&gt; G F# G<br />And someday after we\'ve both chased our fantasies<br />&gt; A<br />Love will bring you back to me<br /> <br />[Bridge]<br />&gt;D Dsus2 D G A<br /> <br />[Verse 2]<br />&gt; D<br />When I\'m gone<br />&gt; B7<br />I\'ll be thinking about you constantly<br />&gt; Em A<br />\'Cause you\'re locked inside my memory from now on<br />&gt; D B7<br />And I know that we said we needed time apart<br />&gt; Em A<br />But your love keeps pulling at my heart, pulling strong<br /> <br />[Pre-chorus]<br />&gt; F#m Bm<br />Will you miss me in the night?<br />&gt; Em A G<br />Will your arms reach out to hold me tight<br />&gt; F#m Bm<br />And keep me in your dreams<br />&gt; G A<br />In your heart, in your life?<br /> <br />[Chorus]<br />&gt; D Bm<br />Sometimes I\'ll wanna run to you like lovers do<br />&gt; Em F# G<br />When love is new and just for a moment be close to you<br />&gt; A<br />Pretending I\'m still holding you.<br />&gt; D Bm<br />And even when I\'m far away the dreams will stay.<br />&gt; Em F# G<br />And someday after we\'ve both chased our fantasies<br />&gt; A<br />Love will bring you back to me<br /> <br />[Interlude]<br />&gt;D Dmaj7 D G A<br />&gt;D Dmaj7 D G A<br /> <br />[Chorus]<br />&gt; D Bm<br />Sometimes I\'ll wanna run to you like lovers do<br />&gt; Em F# G<br />When love is new and just for a moment be close to you<br />&gt; A<br />Pretending I\'m still holding you.<br />&gt; D Bm<br />And even when I\'m far away the dreams will stay.<br />&gt; Em F# G<br />And someday after we\'ve both chased our fantasies.<br />&gt; A<br />Love will bring you back to me.<br />&gt; D Bm<br />Sometimes I\'ll wanna run to you like lovers do<br />&gt; Em F# G<br />When love is new and just for a moment be close to you<br />&gt; A<br />Pretending I\'m still holding you...</p>', 'foreign classic', 'D', '', '2022-10-13 11:33:11'),
(754, 'Until I found you', 437, '<p><br />Original key = Bb</p>\r\n<p>Intro :</p>\r\n<p>&gt;G Bm C Cmn</p>\r\n<p>[Verse 1]<br /> <br />G Bm C<br /> Georgia, wrap me up in all your...<br />G Bm C<br /> I want ya, in my arms<br /> G<br />Oh, let me hold ya<br />Bm C G<br /> I\'ll never let you go again,<br /> <br />like I did<br /> D<br />Oh, I used to say<br /> <br /> <br />[Chorus]<br /> <br /> C D<br />\"I would never fall in love again until<br />G Bm<br />I found her\"<br /> C D<br />I said, \"I would never fall unless it\'s<br />G G7<br />you I fall into\"<br /> C D<br />I was lost within the darkness, but<br /> G Bm<br />then I found her<br /> C Cm<br />I found you<br /> <br /> <br />[Verse 2]<br /> <br />G Bm C<br /> Georgia, pulled me in, I asked to...<br />G Bm C<br /> Love her, once again<br /> G<br />You fell, I caught ya<br />Bm C G<br /> I\'ll never let you go again,<br /> <br />like I did<br /> D<br />Oh, I used to say<br /> <br /> <br />[Chorus]<br /> <br /> C D<br />\"I would never fall in love again until<br />G Bm<br />I found her\"<br /> C D<br />I said, \"I would never fall unless it\'s<br />G G7<br />you I fall into\"<br /> C D<br />I was lost within the darkness, but<br /> G Bm<br />then I found her<br /> C Cm<br />I found you<br /> <br /> <br />[Instrumental]<br /> <br />G Bm C Cm<br /> <br /> <br />[Chorus]<br /> <br /> C D<br />\"I would never fall in love again until<br />G Bm<br />I found her\"<br /> C D<br />I said, \"I would never fall unless it\'s<br />G G7<br />you I fall into\"<br /> C D<br />I was lost within the darkness, but<br /> G <br />then I found her<br /> C Cm<br />I found you</p>', 'first set', 'Bb', '', '2022-10-13 11:35:19'),
(755, 'Don\'t throw it all away', 86, '<p>Original key = F</p>\r\n<p>[Intro]<br />&gt;G Gmaj Am7 D7<br /> <br />&gt;G Gmaj Am7 D7<br /> <br />[Verse]<br />&gt;G Am7 Gmaj C<br /> Maybe I don\'t want to know the reason why<br />&gt;Am7<br /> But lately you don\'t talk to me<br />&gt; C D G Gmaj Am7 D7<br />And darling, I can\'t see me in your eyes<br /> <br />[Verse]<br />&gt;G Am7 Gmaj C<br /> I hold you near, but you\'re so far away<br />&gt; D<br />And it\'s losing you I can\'t believe<br />&gt; Bm C D7 G G7<br />To watch you leave and let this feeling die<br /> <br />[Bridge]<br />&gt;C C#dim Bm7<br /> You alone are the living thing that keeps me alive<br />&gt;Em Am7 D7 G<br /> And tomorrow, if I\'m here without your love<br />&gt; G7<br />You know I can\'t survive<br />&gt;C C#dim Bm7 C G/A<br /> Only my love can raise you high above it all<br /> <br />[Chorus]<br />&gt; Dmaj Dmaj7sus2<br />Don\'t throw it all away, our love, our love<br />&gt; Cmaj G<br />Don\'t throw it all away, our love<br />&gt; Dmaj Dmaj7sus2<br />Don\'t throw it all away, our love, our love<br />&gt; Cmaj G G7<br />Don\'t throw it all away, our love<br /> <br />[Break]<br />&gt;C Cm6 Bm7 E7 Am7 D7<br /> <br />&gt;G Gmaj Am7 D7<br /> <br />[Verse]<br />&gt;G Am7 Gmaj C<br /> We can take the darkness, make if full of light<br />&gt;Am7<br /> But let your love flow back to me<br />&gt; C D7 G G7<br />How can you leave and let this feeling die?<br /> <br />[Bridge]<br />&gt;C C#dim Bm7 Em<br /> This happy room would be a lonely place when you are gone<br />&gt;Am7 D7 G G7<br /> And I won\'t even have your shoulder for the crying on<br />&gt;C C#dim Bm7 C G/A<br /> No other woman\'s love could be as true, I\'m begging you<br /> <br />[Chorus]<br />&gt; Dmaj Dmaj7sus2<br />Don\'t throw it all away, our love, our love<br />&gt; Cmaj G<br />Don\'t throw it all away, our love<br />&gt; Dmaj Dmaj7sus2<br />Don\'t throw it all away, our love, our love<br />&gt; Cmaj G G7<br />Don\'t throw it all away, our love<br /> <br />[Bridge]<br />&gt; C Am C Am<br /> We changed the world, we made it ours to hold.<br />&gt; D G<br /> But dreams are made for those who really try.<br />&gt;Bm E7<br /> This losing you is real.<br />&gt;C#m F#7 Bm E7<br /> But I still feel you here inside.<br /> <br /> <br />[Chorus]<br />&gt; Gmaj Gmaj7sus2<br />Don\'t throw it all away, our love, our love<br />&gt; Fmaj C<br />Don\'t throw it all away, our love<br />&gt; Gmaj Dmaj7sus2<br />Don\'t throw it all away, our love, our love<br /> &gt; Cmaj G G7<br />Don\'t throw it all away, our love<br /> <br /> <br />(repeat to fade)</p>', 'foreign classic', 'G', '', '2022-10-13 11:36:05'),
(756, 'Bakit Hindi ka Crush Ng Crush mo', 323, '<p>Standard Tuning<br />&gt;E - xx24444<br />Use the Bar Chord on Ebm, C#m and C#m<br /> <br />[Intro] <br />&gt;B F# C#m F# (2x)<br /> <br />[Verse 1]<br />&gt;E Ebm<br />Bilib ako sa dami ng naniniwala sa love song<br />&gt;E Ebm<br />Mga nagbubulag-bulagan at nag-iilusyon<br />&gt;E Ebm<br />Mga pa-simple na nagbabakasakaling abangers<br />&gt; C#m F#m<br />Waiting forever, di maka-get over<br /> <br />&gt;E Ebm<br />Bumabalik pa rin ang ubod na kulit na damdamin<br />&gt;E Ebm<br />Mahirap daw na ma-in-love, baliw-baliwan, as in<br />&gt;E Ebm<br />Hindi makayang tanggapin ang final offer na friendship<br />&gt; C#m F#<br />Wagas sa yong isip, ang wish na relationship<br /> <br />[Pre-Chorus]<br />&gt; E Ebm E Em<br />well its complicated now, di niya lang masabi sa\'yo&hellip;<br />&gt; B E Ebm E Em F#<br />na wag ka nang umasa daw, pero yan lang ang totoo<br /> <br />[Chorus]<br />&gt;B F# G#m<br />OH NO, I SHOULD HAVE KNOWN, FRIENDZONE<br />&gt; F# C#m<br />BAT HINDI KA CRUSH NG CRUSH MO, DADADAN, DIDIDAW<br />&gt;E Em<br />WISH MO LANG NA MUTUAL ANG FEELINGS NIYO<br />&gt;B F# G#m<br />OH NO, THERE\'S MORE TO LIFE THAN LOVE<br />&gt; F# C#m<br />PAG HINDI KA CRUSH NG CRUSH MO, DADADAN, DIDIDAW<br />&gt;E Em<br />LIFE IS FUN BUT YOU JUST GOTTA FIND OUT HOW, OH...<br /> <br />&gt;B F# C#m F# <br />Doo-doodoodoo-doodoodoo-doodoodoo<br />&gt;B F# C#m F#<br />Doo-doodoodoo-doodoodoo-doodoodoo <br /> <br />Verse 2<br />&gt;E Ebm<br />Hanggang sa panaginip mo\'y bitin pa rin ang istorya<br />&gt;E Ebm<br />Mahal mo siya, ang twist pala, mahal niya daw ay iba, waaahhh...<br />&gt;E Ebm<br />Ang peg mo lang ay teleseryeng happy ending ang kwento<br />&gt; C#m F#<br />pero pap\'ano, why can\'t you just let go?<br /> <br />[Pre-Chorus]<br />&gt; E Ebm E Em<br />well its complicated now, di niya lang masabi sa\'yo&hellip;<br />&gt; B E Ebm E Em F#<br />na wag ka nang umasa daw, pero yan lang ang totoo<br /> <br />[Chorus]<br />&gt;B F# G#m<br />OH NO, I SHOULD HAVE KNOWN, FRIENDZONE<br />&gt; F# C#m<br />BAT HINDI KA CRUSH NG CRUSH MO, DADADAN, DIDIDAW<br />&gt;E Em<br />WISH MO LANG NA MUTUAL ANG FEELINGS NIYO<br />&gt;B F# G#m<br />OH NO, THERE\'S MORE TO LIFE THAN LOVE<br />&gt; F# C#m<br />PAG HINDI KA CRUSH NG CRUSH MO, DADADAN, DIDIDAW<br />&gt;E Em<br />LIFE IS FUN BUT YOU JUST GOTTA FIND OUT HOW, OH...</p>\r\n<p>&gt;B F# C#m F# <br />Doo-doodoodoo-doodoodoo-doodoodoo<br />&gt;B F# C#m F#<br />Doo-doodoodoo-doodoodoo-doodoodoo <br /> <br />[Bridge]<br />&gt; E Ebm E Em<br />it\'s complicated daw, wag mo nang asahan pa<br />&gt; B E Ebm E Em F#<br />pag \"let\'s be friends for now\", hanap ka na lang ng iba<br /> <br />[Chorus]<br />&gt;C# G# A#m<br />OH NO, I SHOULD HAVE KNOWN, FRIENDZONE<br />&gt; G# D#m<br />BAT HINDI KA CRUSH NG CRUSH MO, DADADAN, DIDIDAW<br />&gt;F# F#m<br />WISH MO LANG NA MUTUAL ANG FEELINGS NIYO<br />&gt;C# G# A#m<br />OH NO, THERE\'S MORE TO LIFE THAN LOVE<br />&gt; G# D#m<br />PAG HINDI KA CRUSH NG CRUSH MO, DADADAN, DIDIDAW<br />&gt;F# F#m<br />LIFE IS FUN BUT YOU JUST GOTTA FIND OUT HOW, OH...</p>', 'fast song', 'E', '', '2022-10-13 11:37:54'),
(757, 'To the bone', 438, '<p>Original key = Eb</p>\r\n<p>[Intro]<br />&gt;F G<br />&gt;F G<br /> <br /> <br />[Verse 1]<br />&gt; F<br />Have I ever told you<br />&gt; G<br />I want you to the bone<br />&gt; F<br />Have I ever called you<br />&gt; G<br />When you are all alone<br />&gt; F<br />And if I ever forget<br />&gt; G<br />To tell you how I feel<br />&gt; F<br />Listen to me now, babe<br />&gt; G<br />I want you to the bone<br /> <br /> <br />[Pre-Chorus]<br />&gt; F G<br />I want you to the bone, oh oh oh oh oh<br />&gt; F G<br />I want you to the bone, oh oh oh oh oh<br /> <br /> <br />[Verse 2]<br />&gt; F<br />Maybe if you can see<br />&gt; G<br />What I feel through my bone<br />&gt; F<br />Every corner in me<br />&gt; G<br />There\'s your presence that grown<br />&gt; F<br />Maybe I nurture it more<br />&gt; G<br />By saying how it feel<br />&gt; F<br />But I did mean it before<br />&gt; G<br />I want you to the bone<br /> <br />I want you to<br /> <br /> <br />[Chorus]<br />&gt; C G<br />Take me home, I\'m fallin\'<br />&gt; Am Em<br />Love me long, I\'m rollin\'<br />&gt; F Em<br />Losing control, body and soul<br />&gt; Dm G<br />Mind too for sure, I\'m already yours<br />&gt; C G<br />Walk you down, I\'m all in<br />&gt; Am Em<br />Hold you tight, you call and<br />&gt; F Em<br />I\'ll take control, body and soul<br />&gt; Dm G<br />Mind too for sure, I\'m already yours<br />&gt; Am Bb<br />Would that be alright?<br />&gt; Am Bb G<br />Hey, would that be alright?<br />&gt; F G<br />I want you to the bone ooh..<br />&gt; F G<br />So bad I can\'t breathe ooh..<br />&gt; F<br />I want you to the bone<br /> <br /> <br />&gt;F G<br />&gt;F G<br /> <br /> <br />[Bridge]<br />&gt; F<br />Of all the ones that begged to stay<br />&gt; G<br />I\'m still longing for you<br />&gt; F<br />Of all the ones that cried their way<br />&gt; G<br />I\'m still waiting on you<br />&gt; F<br />Maybe we seek for something that<br />&gt; G<br />We couldn\'t ever have<br /