 gamay <br />&gt;D C D<br />Ang mga kahilayan nga milumay kang dodong ug <br />&gt;Em<br />inday <br />&gt;D Em D<br />Luyo unya sa \'tong katawa tan-awa ta og may <br />&gt;C<br />kalipay ba</p>\r\n<p>[Adlib]<br />&gt;G Bm Am D G Bm Am D<br />&gt;Em D Em D C<br />padapapapa. . . .<br /> <br />[Verse]<br /> <br />duha, tulo, upat ang malls sa cebu<br />may ayala shoemart may carbon ug happy mart<br />33, 32, 51 ug 82mga cell phone gilabni sa tindero\'g<br />mani liko\'s tuo padung jones avenue<br />you gotta say it cool mura pu\'g amerkano<br />the city smells of guns and goons<br />no more candies and balloons<br /> <br />[Chorus]<br />&gt;G D C<br />Ipaagi lang og lakbay-lakbay patid labay-labay <br />&gt;D G<br />Sa lata nga gamay <br />&gt;D C D<br />Ang mga kahilayan nga milumay kang dodong ug <br />&gt;Em<br />inday <br />&gt;D Em D<br />Luyo unya sa \'tong katawa tan-awa ta og may <br />&gt;C<br />kalipay ba</p>\r\n<p>[Repeat Chorus]</p>', 'bisrock', 'G', '', '2022-10-29 03:46:39'),
