(796, 'I\'m just a kid', 274, '<p>[Intro]<br />&gt;D &ndash; G &ndash; A &ndash; G<br /> <br /> <br />[Verse]<br />&gt; D G<br />I woke up, it was seven<br />&gt; A G<br />Waited till eleven<br />&gt; D G A - G<br />Just to figure out that no one would call.<br />&gt; D G<br />I think I\'ve got a lot of friends<br />&gt; A G<br />But I don\'t hear from them.<br />&gt;D G A<br />What\'s another night all alone?<br />&gt; Em G A<br />When you\'re spending every day on your own<br /> <br />And here it goes ..<br /> <br /> <br />[Chorus]<br />&gt;D G A<br />I\'m just a kid and life is a nightmare<br />&gt;D G A G<br />I\'m just a kid and I know that it\'s not fair<br />&gt;Em G D A<br />Nobody cares cause I\'m alone and the world<br />&gt;Em G A<br />Is havin\' more fun than me<br /> <br />Tonight<br /> <br /> <br />[Interlude]<br />&gt;D &ndash; G &ndash; A &ndash; G<br /> <br /> <br />[Verse]<br />&gt; D G<br />And maybe when the night is dead<br />&gt; A G<br />I\'ll crawl into my bed<br />&gt; D G A &ndash; G<br />Staring at these four walls again<br />&gt; D G<br />I\'ll try to think about the last time<br />&gt;A G<br /> I had a good time,<br />&gt; D G A<br />Everyone\'s got somewhere to go<br />&gt; Em G A<br />And they\'re gonna leave me here on my own<br /> <br />And here it goes<br /> <br /> <br />[Chorus]<br />&gt;D G A<br />I\'m just a kid and life is a nightmare<br />&gt;D G A G<br />I\'m just a kid and I know that it\'s not fair<br />&gt;Em G D A<br />Nobody cares cause I\'m alone and the world<br />&gt;Em G A<br />Is havin\' more fun than me<br /> <br /> <br />[Bridge]<br />&gt;G<br />What the fuck is wrong with me?<br />&gt; A<br />Dont fit in with anybody<br />&gt;D A D G &ndash; D<br />How did this happen to me?<br />&gt;G A D<br />Wide awake, I\'m bored and I can\'t fall asleep<br />&gt; Em A<br />And every night is the worst night ever<br /> <br />&gt;D &ndash; G &ndash; A &ndash; G<br />I\'m just a kid (just a kid) x5<br /> <br /> <br />[Chorus]<br />&gt;D G A<br />I\'m just a kid and life is a nightmare<br />&gt;D G A G<br />I\'m just a kid and I know that it\'s not fair<br />&gt;Em G D A<br />Nobody cares cause I\'m alone and the world is ..<br />&gt;Em G D A<br />Nobody wants to be alone and the world<br />&gt;D G A<br />I\'m just a kid and life is a nightmare<br />&gt;D G A G<br />I\'m just a kid and I know that it\'s not fair<br />&gt;Em G D A<br />Nobody cares cause I\'m alone and the world is ..<br />&gt;Em G D A<br />Nobody wants to be alone in the world<br />&gt;Em G D A<br />Nobody cares cause I\'m alone and the world is<br />&gt;Em G A<br />Having more fun than me, tonight<br /> <br />&gt;G &ndash; A &ndash; D &ndash; Bm &ndash; G &ndash; A &ndash; G<br />&gt;A&ndash;G<br />I\'m all alone ...Tonight<br />Nobody cares...</p>', 'emo', '', '', '2022-10-29 04:14:40'),
(797, 'I\'d really love to see you tonight', 158, '<p>[Intro]<br /> <br />&gt;F FM7 F Bb<br /> <br />&gt;Gm C F<br />Hello, yeah, it\'s been a while.<br />&gt;Gm C F<br />Not much, how \'bout you?<br />&gt;Am Dm<br />I\'m not sure why I\'d call,<br />&gt; C C7<br />I guess I really just wanted to talk to you.<br /> <br /> <br />&gt;Gm C F<br />And I was thinkin\' maybe later on,<br />&gt;Gm C F<br />We could get together for a while.<br />&gt;Am Dm<br />It\'s been such a long time,<br />&gt; C C C C7<br />And I really do miss your smile.<br /> <br />[Chorus]<br />&gt;Bb C Am7<br />I\'m not talking \'bout moving in,<br />&gt; Bb C7 Am7 Dm<br />And I don\'t want to change your life.<br />&gt; BbM7 C<br />But there\'s a warm wind blowin\',<br />&gt; Am7 Dm C7sus F FM7 F Bb<br />The stars around, and I\'d really love to see you tonight.<br /> <br /> <br />&gt;Gm C F<br />We could go walking through a windy park,<br />&gt;Gm C F<br />Or take a drive along the beach.<br />&gt;Am Dm<br />Or stay at home and watch TV<br />&gt; Csus C C C<br />You see, it really doesn\'t matter much to me.<br /> <br /> <br />[Chorus]<br />&gt;Bb C Am7<br />I\'m not talking \'bout moving in,<br />&gt; Bb C7 Am7 Dm<br />And I don\'t want to change your life.<br />&gt; BbM7 C<br />But there\'s a warm wind blowin\',<br />&gt; Am7 Dm C7sus F <br />The stars around, and I\'d really love to see you tonight.</p>\r\n<p><br />&gt;Dm Am<br />I won\'t ask for promises,<br />&gt;Bb C F<br />So you don\'t have to lie.<br />&gt;Dm Am<br />We\'ve both played that game before,<br />&gt;C7sus C7<br />Say I love you, then say goodbye.<br /> <br /> <br />[Chorus]<br />&gt;Bb C Am7<br />I\'m not talking \'bout moving in,<br />&gt; Bb C7 Am7 Dm<br />And I don\'t want to change your life.<br />&gt; BbM7 C<br />But there\'s a warm wind blowin\',<br />&gt; Am7 Dm C7sus F <br />The stars around, and I\'d really love to see you tonight..<br /> <br />(Repeat Chorus while fading)</p>', 'foreign classic', '', '', '2022-1