(799, 'Black is black', 457, '<p>INTRO: <br />&gt;Em D (x4)<br /> <br />&gt;Em D<br />Black is black, I want my baby back.<br />&gt;Em A A7 D<br />It\'s gray, it\'s gray, since she went away, whoooa, whoooa.<br />&gt;D Em A D<br />What can I do? cause I-I-I-I-I\'mmm, I\'m feelin\' blue.<br /> <br />#2.<br />&gt;Em D<br />If I had my way, she\'d be back today.<br />&gt;Em A A7 D<br />But she don\'t intend, to see me again..whoooa, whoooa.<br />&gt;D Em A D<br />What can I do? cause I-I-I-I-I\'mmm, I\'m feelin\' blue.<br /> <br />CHORUS:<br />&gt;Em F#m<br />I can\'t choose, it\'s too much to lose,<br />&gt; G<br />My love\'s too strong,<br />&gt; E<br />Whoooa..maybe if she\'d come back to me,<br />&gt; A A7 F#m B7<br />Then it can\'t go wrong.<br /> <br />#3.<br />&gt;Em D<br />Bad is bad, that I feel so sad.<br />&gt;Em A A7<br />It\'s time, it\'s time, that I found peace of mind, whooa,<br />&gt;D<br />whoooa.<br />&gt;D Em A D<br />What can I do? cause I-I-I-I-I\'m, I\'mmm feelin\' blue.<br /> <br />CHORUS:<br />&gt;Em F#m<br />I can\'t choose, it\'s too much to lose,<br />&gt; G<br />My love\'s too strong,<br />&gt; E<br />Whoooa..maybe if she\'d come back to me,<br />&gt; A A7 F#m B7<br />Then it can\'t go wrong.<br /> <br />#4.<br />&gt;Em D<br />Black is black, I want my baby back.<br />&gt;Em A A7 D<br />It\'s gray, it\'s gray, since she went away, whoooa, whoooa.<br />&gt;D Em A D<br />What can I do? cause I-I-I-I-I\'mmm, I\'m feelin\' blue.<br /> <br />OUTRO:<br />&gt; Em A D D F G D<br />Cause I-I-I-I-I\'m, I\'m feelin\' blue.</p>', 'upbeat', '', '', '2022-10-29 04:23:29'),
(800, 'brother louie louie', 459, '<p>[Intro]<br />&gt;Dm Gm C Dm</p>\r\n<p>&gt; Dm Am<br />Deep love is a burning fire, stay, \'cause then the flames grow higher.<br />&gt; Bb F C<br />Babe, don\'t let him steal your heart, it\'s easy, easy.<br />&gt; Dm Am<br />Girl, this game can\'t last forever, why, we cannot live together?<br />&gt; Gm C<br />Try, don\'t let him take your love from me,</p>\r\n<p><br />&gt; Dm Gm<br />CHORUS 1 : You\'re no good, can\'t you see, Brother Louie, Louie, Louie,<br />&gt; C Dm<br />I\'m in love - set you free, oh, she\'s only looking to me.<br />&gt; Dm Gm<br />Only love breaks her heart, Brother Louie, Louie, Louie,<br />&gt; C Dm<br />only love\'s paradise, oh, she\'s only looking to me.</p>\r\n<p><br />&gt; Dm Gm<br />CHORUS 2 :Brother Louie, Louie, Louie, oh, she\'s only looking to me<br />&gt; C Dm<br />Oh, let it, Louie, she is under cover.<br />&gt; Dm Gm<br />Brother Louie, Louie, Louie, oh, doing what he\'s doing,<br />&gt; C Dm<br />so, leave it Louie, \'cause I\'m her lover.</p>\r\n<p><br />[Repeat Intro]</p>\r\n<p>&gt; Dm Am<br />2. Stay, \'cause this boy wants to gamble, stay, love is more than<br />&gt; Bb F C<br /> he can handle, girl, come on, stay by me forever, ever.<br />&gt; Dm C<br /> Why does he go on pretending that his love is never ending,<br />&gt; Gm C<br /> babe, don\'t let him steal your love from me.</p>\r\n<p>[Repeat chorus]<br />[Repeat Intro]</p>', 'upbeat', '', '', '2022-10-29 04:24:46'),
