(803, 'Down', 462, '<p>(Intro)<br />&gt;G Bm A<br />&gt; F#m G<br />Baby are you down down down down down,<br />&gt; D A<br />Down, Down<br />&gt; Bm7 G<br />Even if the sky is falling down<br />&gt; D A Bm<br />Down, Down<br /> <br />(Verse 1)<br />&gt; G Bm A F#m<br />You ought to know, tonight is the night to let it go,<br />&gt; G Bm A F#m<br />Put on a show, I want to see how you lose control, <br />&gt; G Bm A F#m<br />So leave it behind \'cause we\'ve got a night to get away, <br />&gt; G Bm A A<br />So come on and fly with me, as we make our great escape.<br /> <br />(Chorus)<br />&gt; G D<br />So baby don\'t worry, you are my only, <br />&gt; A Bm7 A G<br />You won\'t be lonely, even if the sky is falling down,<br />&gt; D A<br />You\'ll be my only, no need to worry,<br />&gt; Bm7 A G<br />Baby are you down down down down down,<br />&gt; D A<br />Down, Down<br />&gt; Bm7 A G<br />Baby are you down down down down down,<br />&gt; D A<br />Down, Down<br />&gt; Bm7 A G<br />Even if the sky is falling down<br /> <br />(Verse 2)<br />&gt;G Bm A F#m<br />Just let it be, come on and bring your body next to me, <br />&gt; G Bm A F#m<br />I\'ll take you away, turn this place into our private getaway <br />&gt; G Bm A F#m<br />So leave it behind \'cause we\'ve got a night to get away, <br />&gt; G Bm A F#m<br />So come on and fly with me, as we make our great escape.<br /> <br />(So why don\'t we run away)<br /> <br />(Chorus)</p>\r\n<p>&gt;G Bm A F#m <br />(Rap)<br /> <br />(Chorus)</p>', 'RNB', '', '', '2022-10-29 04:27:59'),
(804, 'YMCA', 463, '<p>[Intro]<br /> <br />&gt;D D<br />&gt;D D7<br /> <br />[Verse 1]<br /> <br />&gt;G<br />Young man, there\'s no need to feel down. <br />&gt; Em<br />I said, young man, pick yourself off the ground. <br />&gt; C<br />I said, young man, \'cause you\'re in a new town <br />&gt; F#m E D C Bm A <br />There\'s no need to be unhappy. <br /> <br />[Verse 2]<br /> <br />&gt;G<br />Young man, there\'s a place you can go. <br />&gt; Em<br />I said, young man, when you\'re short on your dough. <br />&gt; C<br />You can stay there, and I\'m sure you will find <br />&gt; F#m E D C Bm A D D D D<br />Many ways to have a good time. <br /> <br />[Chorus]<br />&gt; G<br />It\'s fun to stay at the Y-M-C-A. <br />&gt; Em<br />It\'s fun to stay at the Y-M-C-A. <br />&gt; Am C<br />They have everything that you need to enjoy, <br />&gt; D7<br />You can hang out with all the boys ... <br /> <br />&gt; G<br />It\'s fun to stay at the Y-M-C-A. <br />&gt; Em<br />It\'s fun to stay at the Y-M-C-A. <br />&gt; Am C<br />You can get yourself cleaned, you can have a good meal, <br />&gt; D7<br />You can do whatever you feel ... <br /> <br />[Verse 3]<br /> <br />&gt;G<br />Young man, are you listening to me? <br />&gt; Em<br />I said, young man, what do you want to be? <br />&gt; C<br />I said, young man, you can make real your dreams. <br />&gt; F#m E D C Bm A <br />But you got to know this one thing! <br /> <br />[Verse 4]<br /> <br />&gt;G<br />No man does it all by himself. <br />&gt; Em<br />I said, young man, put your pride on the shelf, <br />&gt; C<br />And just go there, to the y.m.c.a. <br />&gt; F#m E D C Bm A D D D D<br />I\'m sure they can help you today. <br /> <br />[Chorus]<br />&gt; G<br />It\'s fun to stay at the Y-M-C-A. <br />&gt; Em<br />It\'s fun to stay at the Y-M-C-A. <br />&gt; Am C<br />They have everything that you need to enjoy, <br />&gt; D7<br />You can hang out with all the boys ... <br /> <br />&gt; G<br />It\'s fun to stay at the Y-M-C-A. <br />&gt; Em<br />It\'s fun to stay at the Y-M-C-A. <br />&gt; Am <br />You can get yourself cleaned, you can have a good meal, <br />&gt; D7<br />You can do whatever you feel ... <br /> <br />[Verse 5]<br /> <br />&gt;G<br />Young man, I was once in your shoes. <br />&gt; Em<br />I said, I was down and out with the blues. <br />&gt; C<br />I felt no man cared if I were alive. <br />&gt; F#m E D C Bm A<br />I felt the whole world was so tight ... <br /> <br />[Verse 6]<br /> <br />&gt; G<br />That\'s when someone came up to me, <br />&gt; Em<br />And said, young man, take a walk up the street. <br />&gt; C<br />There\'s a place there called the YMCA<br />&gt; F#m E D C Bm A D D D D<br />They can start you back on your way. <br /> <br />[Repeat Chorus]<br /> <br />[Outro]<br /> <br />&gt; Am C<br />They have everything that you need to enjoy, <br />&gt; D7<br />You can hang out with all the boys ... <br />&gt;G Em<br />Y-M-C-A ... you\'ll find it at the Y-M-C-A. <br />&gt; G<br />Young man, young man, there\'s no need to feel down. <br />&gt; Em<br />Young man, young man, get yourself off the ground. <br />&gt;G Em<br />Y-M-C-A ... you\'ll find it at the Y-M-C-A. <br />&gt; G<br />Young man, young man, there\'s no need to feel down. <br />&gt; Em<br />Young man, young man, get yourself off the ground. <br />&gt;G Em<br />Y-M-C-A ... just go to the Y-M-C-A. <br />&gt;G<br />Young man, are you listening to me? <br />&gt; Em<br />I said, young man, what do you want to be?</p>', 'upbeat', '', '', '2022-10-30 09:12:44'),
(805, 'Who\'s that Girl', 464, '<p>[Verse 1]<br />&gt; C<br />I was on the mic<br />&gt; Am7<br />Doin\' my thing on a friday night<br />&gt; Dm<br />Had the floor burning up just right<br />&gt; F G<br />Everybody was bumpin\', the club was jumping<br />&gt; C<br />Suddenly, you walked in<br />&gt; Am7<br />That\'s when everybody stopped dancing<br />&gt; Dm<br />And I couldn\'t stop myself staring<br />&gt; F G<br />Yeah I couldn\'t breathe, No I couldn\'t believe my eyes<br /> <br />&gt;C<br /> I never thought I\'d fall in love in a club<br />&gt;Am7<br /> But now I seen you girl I can\'t get enough<br />&gt;Dm<br /> With you I know there\'s no taking it slow<br />&gt;F G<br /> So can somebody please let me know<br /> <br />[Chorus]<br />&gt; C<br />Tell me who\'s that girl<br />Just walk walk (walk) in the club<br />&gt; Am<br />Tell me who\'s that girl<br />Just walk walk (walk) in the club<br />&gt; Dm<br />Tell me who\'s that girl<br />Just walk walk (walk) in the club<br />Just walk walk (walk) in the club<br />&gt; F<br />Just walk walk (walk), walk walk (walk), yeah</p>\r\n<p>[Verse II]<br />&gt; C<br />Before the night is through<br />&gt; Am7<br />Imma tell ya how I feel about you<br />&gt; Dm<br />And I know I got some work to do<br />&gt; F G<br />To make you believe that you should be leaving with me<br /> <br />&gt;C<br /> I never thought I\'d fall in love in a club<br />&gt;Am7<br /> The more I get of you, I can\'t get enough<br />&gt;Dm<br /> I won\'t be letting you leave here alone<br />&gt;F G<br /> So can somebody please let me know<br /> <br />[Chorus] x 2<br /> <br />[Eve]<br />E.V.E<br />&gt; C<br />I walk in the club it\'s over<br />All them other chicks might as well move over<br />&gt; Am7<br />Wanna know my name then you gotta get closer<br />Eyes on you too wanna get to know ya<br />&gt; Dm<br />Lemme run it down for ya, I\'m not easy<br />Some say caramel, you can call my evie<br />&gt; F <br />Wanna be the man in my life that please me