(807, 'Tick Tock', 465, '<p>&nbsp;</p>\r\n<p>&gt;Bb C Dm<br />Wake up in the mornin\' feelin\' like P Diddy (hey, what up girl?)<br />&gt;Bb C Dm<br />Grab my glasses, I\'m out the door, I\'m gonna hit this city (let\'s go)<br />&gt;Bb C Dm<br />Before I leave, brush my teeth with a bottle of Jack<br />&gt;Bb C Dm<br />\'Cause when I leave for the night, I ain\'t comin\' back</p>\r\n<p>[Refrain]<br />&gt;Bb<br />I\'m talkin\' pedicure on our toes, toes<br />&gt; C Dm<br />Tryin\' on all our clothes, clothes<br />&gt;Bb<br />Boys blowin\' up our phones, phones<br />&gt;Bb<br />Drop-toppin\', playin\' our favorite CDs<br />&gt;C Dm<br />Pullin\' up to the parties<br />&gt;Gm<br />Tryna get a little bit tipsy</p>\r\n<p>[Chorus]<br />&gt;Bb<br />Don\'t stop, make it pop<br />&gt;C Dm<br />DJ, blow my speakers up<br />&gt;Bb<br />Tonight, I\'ma fight<br />&gt; C Dm<br />\'Til we see the sunlight<br />&gt;Bb<br />Tick-tock on the clock<br />&gt;C Dm<br />But the party don\'t stop, no<br />&gt;Gm<br />Oh, whoa, whoa-oh<br />&gt;Dm C<br />Oh, whoa, whoa-oh</p>\r\n<p>&gt;Bb<br />Don\'t stop, make it pop<br />&gt;C Dm<br />DJ, blow my speakers up<br />&gt;Bb<br />Tonight, I\'ma fight<br />&gt; C Dm<br />\'Til we see the sunlight<br />&gt;Bb<br />Tick-tock on the clock<br />&gt;C Dm<br />But the party don\'t stop, no<br />&gt;Gm<br />Oh, whoa, whoa-oh<br />&gt;Dm C<br />Oh, whoa, whoa-oh</p>\r\n<p><br />[Repeat chords]<br />[Verse II]<br />Ain\'t got a care in the world, but got plenty of beer<br />Ain\'t got no money in my pocket, but I\'m already here<br />And now the dudes are linin\' up \'cause they hear we got swagger<br />But we kick \'em to the curb unless they look like Mick Jagger</p>\r\n<p>[Refrain]<br />I\'m talkin\' \'bout everybody gettin\' crunk, crunk<br />Boys try to touch my junk, junk<br />Gonna smack him if he gettin\' too drunk, drunk<br />Now, now, we go until they kick us out, out<br />Or the police shut us down, down<br />Police shut us down, down<br />P