(808, 'Starting over again', 466, '<p>&gt;C</p>\r\n<p>[Verse]<br /> <br />&gt; FM7 CAug/G# C - C7<br />And when I hold you in my arms I promise you<br />&gt; FM7 CAug/G# C - C7<br />You\'re gonna feel a love that\'s beautiful and new<br />&gt; F E7 Am G F#<br />This time I\'ll love you even better than I ever did before<br />&gt; G C<br />And you\'ll be in my heart forevermore<br /> <br />&gt;C F Dm E7 - E/G#<br />We, we\'re just too young to know we fell in love and let it go<br />&gt; Am G Dm D G<br />So easy to say the words goodbye, so hard to let the feelings die<br /> <br />&gt;C F Dm E7 - E/G#<br />I know how much I need you now, the time is turning back somehow<br />&gt; Am G Dm D <br />As soon as our hearts and souls unite<br />&gt; G C - Bb/G# Bb<br />I know for sure we\'ll get the feeling right<br /> <br /> <br />[Chorus]<br /> <br />&gt; Eb Ab Fm Bb Eb<br />And now we\'re starting over again, it\'s not the easiest thing to do<br />&gt;Cm Bb F/Am Bb<br />I\'m feeling inside again, \'cause every time I looked at you<br />&gt; Eb Eb/Gm Ab Fm Bb Eb<br />I know we\'re starting over again, this time we\'ll love all the pain away<br />&gt;Cm Bb F/Am Bb <br />Welcome home my lover and friend, we are starting over, over again<br /> <br />&gt;Dm G<br /> <br />&gt;C F Dm E7 - E/G#<br />If we never leave alone, and then we might have never known<br />&gt; Am G Dm D G C<br />All the times we spent apart, all we did was break each other\'s heart.<br /> <br /> <br />[Instrumental]<br /> <br />&gt;F- CAug/G#- C - C7 2x<br /> <br /> <br />[Verse]<br /> <br />&gt; Ab Abm Eb<br />And when I hold you in my arms I promise you<br />&gt; Ab Abm Eb<br />You\'re gonna feel the love that\'s beautiful and new<br />&gt; Ab G7 Cm Bb Am/F<br />This time I\'ll love you even better, than I ever did before<br />&gt; Bb Eb - C#<br />And you\'ll be in my heart forever more.<br /> <br /> <br />[Chorus]<br /> <br />&gt; F# B G#m C# F#<br />And now we\'re starting over again, it\'s not the e