(811, 'Just Dance', 203, '<p><br />[Intro]<br /> <br />&gt; Am C G Dm<br />e|----------0-0-0-0-------1-1-1-1-0--|<br />B|--1-1-1-1---------0-0-0------------|<br />D|-----------------------------------|<br />G|------------------------0-0-0-0-0--|<br />A|--0-0-0-0-3-3-3-3------------------|<br />E|------------------3-3-3------------|(x3)<br /> <br /> <br />[Intro]<br /> <br />&gt; Am C G Dm<br />A Red One (Konvict)<br />&gt; Am C G Dm<br />Ga Ga (oh oh, eh)<br /> <br /> <br />[Verse 1]<br /> <br />&gt;Am C G Dm<br /> I\'ve had a little bit too much, much (oh oh oh, oh)<br />&gt;Am C G Dm<br /> All of the people start to rush, start to rush babe<br />&gt;Am C G Dm<br /> How does he twist the dance, can\'t find my drink or man<br />&gt;Am C G Dm<br /> Where are my keys, I lost my phone, phone<br /> <br /> <br />[Pre-Chorus]<br /> <br />&gt;F Am<br /> What\'s going out on the floor?<br />&gt; F<br />I love this record baby, but I can\'t see straight anymore<br />&gt; Am<br />Keep it cool what\'s the name of this club?<br /> <br />I can\'t remember but it\'s alright, alright<br /> <br /> <br />[Chorus]<br /> <br />&gt; Am C G Dm<br />Just dance, gonna be okay da doo doo doo<br />&gt; Am C G Dm<br />Just dance, spin that record babe da doo doo doo<br />&gt; Am C G Dm<br />Just dance. gonna be okay duh duh duh duh<br />&gt;Am C G Dm<br />Dance, dance, dance, just-ju-ju dance</p>\r\n<p>[stop]</p>\r\n<p>[Bridge]<br /> <br />&gt;Am C G Dm<br /> Wish I could shut my playboy mouth (oh oh oh oh)<br />&gt;Am C G Dm<br /> How&rsquo;d I turn my shirt inside out, inside out right<br />&gt;Am C G Dm<br /> Control your poison babe, roses have thorns they say<br />&gt;Am C G Dm<br /> And we&rsquo;re all gettin&rsquo; hosed tonight (oh oh oh oh)<br /> <br /> <br />[Pre-Chorus]<br /> <br />&gt;F Am<br /> What\'s going out on the floor?<br />&gt; F<br />I love this record baby, but I can\'t see straight anymore<br />&gt; Am<br />Keep it cool what\'s the name of this club?<br /> <br />I can\'t remember but it\'s alright, alright<br /> <br /> <br />[Chorus]<br /> <br />&gt; Am C G Dm<br />Just dance, gonna be okay da doo doo doo<br />&gt; Am C G Dm<br />Just dance, spin that record babe da doo doo doo<br />&gt; Am C G Dm<br />Just dance. gonna be okay duh duh duh duh<br />&gt;Am C G Dm<br />Dance, dance, dance, just-ju-ju dance<br /> <br /> <br />[Verse 3] (Colby O\'Donis)<br /> <br />&gt;Am C G Dm<br /> When I come through on the dance floor checkin\' out that catalogue<br />&gt;Am C G Dm<br /> Can&rsquo;t believe my eyes so many women without a flaw<br />&gt;Am C G Dm<br /> And I ain&rsquo;t gon&rsquo; give it up, steady tryin\' a pick it up like the call<br />&gt;Am C G Dm F<br /> I&rsquo;ma hit it, I&rsquo;ma get it and flex and do it, until tomorr&rsquo;, yeah<br />&gt; F<br />shawty I can see that you got so much energy<br />&gt; Am<br />The way you twirling up them hips round and round<br />&gt; F<br />and there is no reason, I know why you can&rsquo;t leave here with me<br />&gt; Am<br />In the meantime stand, let me watch you break it down and<br /> <br /> <br />[Chorus]<br /> <br />&gt; Am C G Dm<br />Just dance, gonna be okay da doo doo doo<br />&gt; Am C G Dm<br />Just dance, spin that record babe da doo doo doo<br />&gt; Am C G Dm<br />Just dance. Gonna be okay duh duh duh duh<br />&gt;Am C G Dm<br />Dance, dance, dance, just ju-ju just dance<br /> <br /> <br />[Instrumental]<br /> <br />&gt;Am C G Dm (x4)<br /> <br /> <br />[Bridge]<br /> <br />Half psychotic synchypnotic<br />Got my blue burners and phonic<br />half psychotic synchypnotic<br />Got my brand electronic<br />Half psychotic synchypnotic<br />Got my blue burners and phonic<br />Half psychotic synchypnotic<br />Got my brand electronic<br /> <br />Go! Use your muscle carve it out work and hustle<br />I got it, just stay close enough to get it<br />GO slow. Drive it, clean it like so pleaded<br />spend the last dough (I got it)<br />in your pock-oh (I got it)<br /> <br /> <br />