------------------------------|<br /> <br /> <br />[Chorus]<br /> <br />&gt;A F#m D E<br />bakit bakit ba iniwan mong nag iisa<br />&gt;A F#m D E<br />bakit bakit ba sa akin bay nag sawa na<br />&gt; D E D E<br />sinusunod naman kita kahit ano kinakaya<br />&gt; D E<br />wala paring kwenta <br />&gt; A F#m D E<br />bakit ba?<br /> <br /> <br />[Outro]<br /> <br />&gt;A F#m D E<br /> <br />&gt;A F#m D E<br /> <br />&gt;A</p>', 'opm rock', '', '', '2022-10-30 09:53:06'),
(827, 'Byaheng Impyerno', 475, '<p>[Intro]<br />&gt;D Bm G A<br /> <br />[Verse]<br />&gt;D Bm<br />Bakas sa akin isipan ang bisyong pinasukan<br />&gt;G A<br />Hindi ko maliwanagan akoy nalalabuan<br />&gt;D Bm<br />Mantia sa katauhan ligayang maiwasan<br />&gt;G A<br />Habang tumatagal lalong sasabayan<br /> <br />[Refrain]<br />&gt;G A<br />Nais mang bumaba tuloy-tuloy pa rin<br />&gt;G A<br />Nais mang pigilan hayaan ng hanapin<br />&gt; G A<br />Saan \'to patutungo daang bako-bako<br />&gt;G A<br />Ayoko ng ganito biyaheng impiyerno</p>\r\n<p>[Chorus]<br />&gt;D Bm<br />Mama para dyan lang sa tabi<br />&gt;G A<br />Dyan lang sa tabi ngunit bakit di ko masabi<br />&gt;D Bm<br />Bakit di ko masabi na ako ay bababa<br />&gt;G A<br />Ako ay bababa pag bumaba na ang aking tama</p>\r\n<p><br />[Instrumental]2X<br />&gt;D Bm G A <br /> <br />[Verse]<br />&gt;D Bm<br />Mula ng mag kaisip ay aking ini-isip<br />&gt;G A<br />Kung ba\'t ang nangyayari di ko lubos maisip<br />&gt;D Bm<br />Hindi ko malama kung ito ay panaginip<br />&gt;G A<br />Gusingin nyo ako sino ang sasagip</p>\r\n<p>[Refrain]<br />&gt;G A<br />Nais mang bumaba tuloy-tuloy pa rin<br />&gt;G A<br />Nais mang pigilan hayaan ng hanapin<br />&gt; G A<br />Saan \'to patutungo daang bako-bako<br />&gt;G A<br />Ayoko ng ganito biyaheng impiyerno</p>\r\n<p>[Chorus]<br />&gt;D Bm<br />Mama para dyan lang sa tabi<br />&gt;G A<br />Dyan lang sa tabi ngunit bakit di ko masabi<br />&gt;D Bm<br />Bakit di ko masabi na ako ay bababa<br />&gt;G A<br />Ako ay bababa pag bumaba na ang aking tama</p>\r\n<p>&nbsp;</p>\r\n<p>[Instrumental] 2X<br />&gt;D Bm G A</p>\r\n<p><br />[Verse]<br />Mga laking kalye istambay sa gabi<br />Mga walang trabaho walang gawang mabuti<br />Siksikan na kami tuloy pa rin ang biyahe<br />Suko na ko dito bayad na \'ko pare<br /> <br />&gt;G A<br />Nais mang bumaba tuloy-tuloy pa rin<br />&gt;G A<br />Nais mang pigilan hayaan ng hanapin<br />&gt; G A<br />Saan \'to patutungo daang bako-bako<br />&gt;G A<br />Ayoko ng ganito biyaheng impiyerno</p>\r\n<p>Chorus<br />&gt;D Bm<br />Mama para dyan lang sa tabi<br />&gt;G A<br />Dyan lang sa tabi ngunit bakit di ko masabi<br />&gt;D Bm<br />Bakit di ko masabi na ako ay bababa<br />&gt;G A<br />Ako ay bababa pag bumaba na ang aking tama</p>', 'opm rock', '', '', '2022-10-30 09:53:50'),
(828, 'Gabay', 475, '<p>Gabay- Siakol<br /> <br /> <br />[Intro]<br /> <br />&gt;D A Bm F# G D Em A<br /> <br /> <br />[Verse]<br /> <br />&gt;D A <br />Maririnig sa&rsquo;yo<br />&gt;Bm F# <br />Sa pag daing mo sa mondo<br />G D Em A<br />Ang katahimikan malayo sa gulo</p>\r\n<p>&gt;D A Bm F# G D Em A<br />Sa iinusenteng mga mata<br />Makikita pa kita<br />Wala ang kamunduhan<br />Walang pangangamba<br /> <br /> <br />[Bridge]<br /> <br />G D A D <br />Humawak ka lamang sa aking kamay<br />Ng matuklasan ang ganda nitong buhay<br />G D E A (pause)<br />Iingatan kasi pababayaan<br />Gabay mo ako sa iyong kapaligiran<br /> <br /> <br />[Chorus]<br /> <br />&gt;D A Bm F# G D Em A <br />Kaluskos ng dahon<br />Huni ng mga ibon malayo sa dilim ng kahapon<br />Hampas ng mga alon<br />Kasiyahan sa nayon<br />Mga batang naglalaro lang maghapon<br />Simoy ng hangin, sari saring tanawin<br />Paligid na iyong tatahakin<br />Pagkat walang sawa kitang aarugain<br />Sa paraisong kina lalagyan natin.</p>\r\n<p><br />[Intro]<br /> <br />&gt;D A Bm F# G D Em A</p>\r\n<p><br />[Verse]<br /> <br />&gt;D A Bm F# G D Em A <br />Madamara sa iyo upang mahubog ng husto<br />Ang kabutihan sa kapwa tao<br />At sa mura mong isipan dapat ng malaman<br />Na may dyos tayo na pasalamatan..</p>\r\n<p>[Repeat Bridge]<br />[Repeat Chorus]<br />[Lead]<br />[Bridge]<br />[Repeat Chorus]<br />[Lead]</p>', 'opm rock', '', '', '2022-10-30 09:54:22'),
(829, 'Gawing langit ang mundo', 475, '<p>[Intro]<br /> <br />&gt;A C#m D Dm x2<br /> <br /> <br />[Verse 1]<br /> <br />&gt; A C#m<br />Hindi nila naririnig hinanaing sa barung-barong<br />&gt; D Dm<br />Dahil palasyo nilay may matibay na bubong<br />&gt; A C#m<br />Hindi nila naririnig mga kumakalam na tyan<br />&gt; D Dm<br />\'Di tulad ng mesa nilang parang laging may handaan<br />&gt; E Bm E E7<br />Ikaw ba? Naririnig mo ba sila ikaw ba?<br /> <br /> <br />[Chorus]<br /> <br />&gt; A C#m<br />Gawin langit ang mundo makakaya natin to<br />&gt; D Dm<br />Sa simula ikaw at ako tapos sila<br />&gt; A<br />Hanggang maging lahat na tayo<br />&gt; C#m<br />Oh kay gandang masdan sa bawat taong<br />&gt; D Dm<br />Nagugutom at nahihirapan meron kang<br />&gt; E E7<br />Matutulungan OH gawing langit ang mundo<br /> <br /> <br />[tapos intro]<br /> <br /> <br />[Verse 2]<br /> <br />&gt; A C#m<br />Wala silang pakiramdam sa nangyayaring kaguluhan<br />&gt; D Dm<br />Basta mabulsa lang nila ang kaban ng ating bayan<br />&gt; A C#m<br />Wala silang pakiramdam magkaroon man ng digmaan<br />&gt; D Dm<br />Kapangyarihan na nilang gawin tayong tao-tauhan<br />&gt; E Bm E E7<br />Ikaw ba? Nadarama mo ba ito ikaw ba?<br /> <br /> <br />[Chorus]<br /> <br />&gt; A C#m<br />Gawin langit ang mundo makakaya natin to<br />&gt; D Dm<br />Sa simula ikaw at ako tapos sila<br />&gt; A<br />Hanggang maging lahat na tayo<br />&gt; C#m<br />Oh kay gandang masdan sa bawat taong<br />&gt; D Dm<br />Nagugutom at nahihirapan meron kang<br />&gt; E E7 B<br />Matutulungan oh gawing langit ang mundo<br /> <br /> <br />[Bridge]<br /> <br />&gt; E C#m<br />Habang maaga pa kahit man lang<br />&gt; F#m Bm Dm Bm<br />sa kapakanan ng iba ng mga batang maglalakihan makikinabang sa ating<br />&gt; E E7<br />maiiwanan na pagmamahalan<br /> <br /> <br />[Instrumental]<br /> <br />&gt;A C#m D Dm x2 E E7<br /> <br /> <br />[Chorus]<br /> <br />&gt; A C#m<br />Gawin langit ang mundo makakaya natin to<br />&gt; D Dm<br />Sa simula ikaw at ako tapos sila<br />&gt; A<br />Hanggang maging lahat na tayo<br />&gt; C#m<br />Oh kay gandang masdan sa bawat taong<br />&gt; D Dm<br />Nagugutom at nahihirapan meron kang<br />&gt; E E7 <br />Matutulungan oh gawing langit ang mundo</p>\r\n<p><br />&gt; A C#m<br />Gawin langit ang mundo makakaya natin to<br />&gt; D Dm<br />Sa simula ikaw at ako tapos sila<br />&gt; A<br />Hanggang maging lahat na tayo<br />&gt; C#m<br />Oh kay gandang masdan sa bawat taong<br />&gt; D Dm<br />Nagugutom at nahihirapan meron kang<br />&gt; E E7 B<br />Matutulungan oh gawing langit ang mundo</p>\r\n<p><br />&gt; A C#m<br />Gawin langit ang mundo makakaya natin to<br />&gt; D Dm<br />Sa simula ikaw at ako tapos sila<br />&gt; A<br />Hanggang maging lahat na tayo<br />&gt; C#m<br />Oh kay gandang masdan sa bawat taong<br />&gt; D Dm<br />Nagugutom at nahihirapan meron kang<br />&gt; E E7 <br />Matutulungan oh gawing langit ang mundo</p>', 'opm rock', '', '', '2022-10-30 09:55:00');
