(830, 'Hindi mo ba alam', 475, '<p><br />[Intro]<br /> <br />&gt;G - C <br />&gt;G - C <br />&gt;G - C <br />&gt;D<br /> <br /> <br />[Verse]<br /> <br />&gt;G C G C<br />Hindi mo ba alam na ako\'y nasasaktan<br />&gt; G C D<br />Sa tuwing ikaw ay aalis at hindi nag paalam<br />&gt;Em Bm Em Bm<br />Nais kong malaman mo na ako\'y nag tatampo<br />&gt;C Am D<br />Pag nalimutan mo ang pasalubong ko<br /> <br />&gt;G C G C<br />Hindi mo ba alam na ako\'y nasasaktan<br />&gt; G C D<br />Pag nakikita kitang may ibang ka kwentuhan<br />&gt; Em Bm Em Bm<br /> Nais kong malaman mo na ako\'y nandirito<br />&gt;C Am D<br />Pwede ba ako kahit maki usyoso<br /> <br /> <br />[Chorus]<br /> <br />&gt; C D Bm Em<br />Ngunit pag sapit ng gabi heto ka sa \'king tabi<br />&gt; Am D G G7<br />Sa pag ibig mo \'di ako nag sisisi<br />&gt; C D Bm<br />At pag gising sa umaga maamo mong <br />&gt; Em<br />mukha ang nakikita<br />&gt; Am D G<br />Na sa akin ay lubos na nagpa-paligaya.<br /> <br /> <br />[Instrumental]<br /> <br />&gt;G - C <br />&gt;G - C <br />&gt;G - C <br />&gt;D<br /> <br /> <br />[Verse]<br /> <br />&gt; G C G C<br />Hindi mo ba alam na ako\'y nasasaktan <br />&gt; G C D<br />Sa tuwing ika\'y na lulungkot at mata ay luhaan <br />&gt; Em Bm Em Bm<br />Nais kong malaman mo yan ay pupunasan ko <br />&gt; C Am D<br />Sa katapatan ng pagmamahal ko sa iyo.<br /> <br />[Chorus]<br /> <br />&gt; C D Bm Em<br />Ngunit pag sapit ng gabi heto ka sa \'king tabi<br />&gt; Am D G G7<br />Sa pag ibig mo \'di ako nag sisisi<br />&gt; C D Bm<br />At pag gising sa umaga maamo mong <br />&gt; Em<br />mukha ang nakikita<br />&gt; Am D G<br />Na sa akin ay lubos na nagpa-paligaya.<br /> <br /> <br />[Solo]<br /> <br />e|---------------------8-7--7--10-8-7--5--7-8--------------------------------|<br />B|-----------7--5s7--7---------------------------------7-10-11---------------|<br />G|-----4-5-7---------------------------------------7-9---------7-9-----------|<br />D|-5-7-------------------