(831, 'lakas tama', 475, '<p>[Intro]<br /> <br />&gt; Ebm - B - Bb - Eb (4x) slow<br />&gt; Ebm - B - Bb - Eb (2x) fast<br /> <br /> <br />[Verse 1]<br /> <br />&gt; Ebm B<br />Bulag ang pag-ibig kasabihan na sa atin<br />&gt; Bb Ebm<br />Ngunit para sa \'yo ang pag-ibig ko ay duling<br />&gt; Ebm B<br />Pagkat dalawang beses ako sa \'yo may pagtingin<br />&gt; Bb Ebm<br />Kaytindi ng \'yong dating sa puso\'t damdamin.<br />&gt; Ebm B<br />Sa tunay kong pagmamahal natotorpe sa \'yo<br />&gt; Bb Ebm<br /> <br /> Mukhang pinasukan ng daga ang puso kong bato<br />&gt; Ebm B<br />Dahil alam ko rin walang ibubunga ito<br />&gt; Bb Ebm<br />Natatakot akong mawala ang isang katulad mo.<br /> <br /> <br />[Chorus]<br /> <br />&gt; Ebm B<br />Lakas tama! Ako\'y nawawala<br />&gt; Bb Ebm<br />Nawawala ang isip ko pag nakikita ka, sinta<br />&gt; Ebm B<br />Lakas tama! Ako\'y nawawala<br />&gt; Bb Ebm (break)<br />Nawawala ang isip ko pag nakikita ka,<br />(break) (pause)<br />sinta.<br /> <br /> <br />[Ad lib] <br />&gt;Ebm - B - Bb - Eb (2x)<br /> <br /> <br />[Verse 2] (1st verse chord pattern)<br /> <br />Mga kamay ko ay nanginginig na sa iyo<br />Na makayakap ka sa tuwing giniginaw ako<br />At ang iyong labi na sa akin ay tumutukso<br />Kailan mahahagkan nang matapos na ang gulo?<br /> <br />Sa pagputi ba ng uwak mo ako sasagutin<br />Kung ang kulay ko nga ay kayhirap paputiin<br />Ipagpatawad mo na lang kung agad kang mahalin<br />Gan\'to ako kung umibig medyo napa-praning.<br /> <br /> <br />[Chorus]<br /> <br />&gt; Eb B<br />Lakas tama! Ako\'y nawawala<br />&gt; Bb Eb<br />Nawawala ang isip ko pag nakikita ka, sinta<br />&gt; Eb B<br />Lakas tama! Ako\'y nawawala<br />&gt; Bb Eb (break)<br />Nawawala ang isip ko pag nakikita ka,<br />(break) (pause)<br />sinta.<br /> <br /> <br />[Ad lib] <br />&gt;Ebm - B - Bb - Eb (2x)<br /> <br /> <br />[Chorus]<br /> <br />&gt;Eb B<br />Lakas tama! Ako\'y nawawala<br />&gt;Bb Eb<br />Nawawala ang isip ko pag nakikita ka, sinta<br />&gt;Eb B<br />Lakas tama! Ako\'y nawawala<br />&gt;Bb Eb (break)s<br />Nawawala ang isip ko pag nakikita ka,<br />(break) (pause)<br />sinta.</p>\r\n<p>&nbsp;</p>\r\n<p>&gt;Eb B<br />Lakas tama! Ako\'y nawawala<br />&gt;Bb Eb<br />Nawawala ang isip ko pag nakikita ka, sinta<br />&gt;Eb B<br />Lakas tama! Ako\'y nawawala<br />&gt;Bb Eb (break)<br />Nawawala ang isip ko pag nakikita ka,</p>\r\n<p>sinta.</p>', 'opm rock', '', '', '2022-10-30 09:56:15'),
(832, 'Tropa', 475, '<p>[INTRO]<br /> <br />&lt;E - B - C#m - A - B &gt;<br /> <br /> <br />[Verse 1] (DO THIS CHORDS: <br />&lt;E - B - C#m - A - B &gt;<br /> <br />kwentuhan na kabulastugan<br /> <br />hindi malilimutan ang asaran<br /> <br />na mayroong pikunan<br /> <br />lalo na rin ang unang niligawan<br /> <br />unang kabiguan<br /> <br />at dyan nagseseryoso ang usapan<br /> <br />ang pagdadamayan<br /> <br /> <br /> <br />[Refrain] (&lt; A - B &gt; 2x)<br /> <br />ng tunay at tapat na<br /> <br />kaibigan<br /> <br />o mga buang/baliw<br /> <br />kaibigan<br /> <br />lubhang maasahan/namang nakakaaliw<br /> <br /> <br />ohhh.<br /> <br /> <br />[Chorus] (DO THIS CHORDS: &lt;E - B - C#m - A - B &gt;)<br /> <br />di na tayo pabata<br /> <br />edad mo di nahahahlata<br /> <br />sa mga trip unti unti na tayong nagsasawa<br /> <br />pero kahit ganun<br /> <br />barkadang matatag hangang sa ngaun<br /> <br />minsan man magkita<br /> <br />tiyak may kwela<br /> <br />yan ang aking mga tropa...<br /> <br /> <br /> <br />[Repeat INTRO]<br /> <br /> <br />[Verse 2] (DO THIS CHORDS: &lt;E - B - C#m - A - B &gt;)<br /> <br />Inuman na pangmagdamagan<br /> <br />minsan inaabut pa ng ayaan<br /> <br />na kung saan saan<br /> <br />na para bang walang kinabukasan<br /> <br />at kahahantungan<br /> <br />at dyan nagseseryoso ang usapan<br /> <br />ang pagpapayuhan<br /> <br /> <br /> <br />(repeat refrain and chorus)<br /> </p>', 'opm rock', '', '', '2022-10-30 09:56:58'),
